import React, { useEffect, useState } from "react";

export default function AdminQuestions({ goBack }) {

  const [questions, setQuestions] = useState([]);
  const token = localStorage.getItem("token");

  useEffect(() => {
    fetchQuestions();
  }, []);

  const fetchQuestions = async () => {
    const res = await fetch("http://localhost:8080/api/admin/questions", {
      headers: { Authorization: `Bearer ${token}` }
    });
    const data = await res.json();
    setQuestions(data);
  };

  const deleteQuestion = async (id) => {
    await fetch(`http://localhost:8080/api/admin/questions/${id}`, {
      method: "DELETE",
      headers: { Authorization: `Bearer ${token}` }
    });
    fetchQuestions();
  };

  return (
    <div className="p-10">
      <button onClick={goBack} className="mb-6 text-blue-600">
        ‚Üê Back
      </button>

      <h2 className="text-2xl font-bold mb-6">Manage Questions</h2>

      <table className="w-full bg-white shadow rounded-lg">
        <thead>
          <tr className="bg-gray-200">
            <th className="p-3">ID</th>
            <th>Question</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {questions.map(q => (
            <tr key={q.id} className="text-center border-t">
              <td className="p-3">{q.id}</td>
              <td>{q.questionText}</td>
              <td>
                <button
                  onClick={() => deleteQuestion(q.id)}
                  className="bg-red-500 text-white px-3 py-1 rounded"
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
